class Solution { 
static final HashMap<BigInteger, BigInteger> triple = new HashMap<>();
  public static BigInteger tripleFib(BigInteger a) {
        if(a.equals(BigInteger.ZERO)) return BigInteger.ONE;
        if(a.equals(BigInteger.ONE)) return BigInteger.ONE;
        if(a.equals(BigInteger.valueOf(2))) return BigInteger.ONE;
        if(a.equals(BigInteger.valueOf(3))) return BigInteger.valueOf(3);
        if(triple.containsKey(a)) return triple.get(a);
        else {
            BigInteger fibout = tripleFib(a.subtract(BigInteger.valueOf(3))).add(tripleFib(a.subtract(BigInteger.valueOf(2)))).add(tripleFib(a.subtract(BigInteger.ONE)));
            triple.put(a, fibout);
            return fibout;
        }
    }
}

    @Test
    void tripleFibTest() {
        assertEquals(BigInteger.valueOf(1), Fibonacci.tripleFib(BigInteger.valueOf(0)));
        assertEquals(BigInteger.valueOf(1), Fibonacci.tripleFib(BigInteger.valueOf(1)));
        assertEquals(BigInteger.valueOf(1), Fibonacci.tripleFib(BigInteger.valueOf(2)));
        assertEquals(BigInteger.valueOf(3), Fibonacci.tripleFib(BigInteger.valueOf(3)));
        assertEquals(BigInteger.valueOf(5), Fibonacci.tripleFib(BigInteger.valueOf(4)));
        assertEquals(BigInteger.valueOf(9), Fibonacci.tripleFib(BigInteger.valueOf(5)));
        assertEquals(BigInteger.valueOf(17), Fibonacci.tripleFib(BigInteger.valueOf(6)));

    }
